INSERT INTO `pl` (`img`, `id`, `discript`) VALUES
(, 1, 'Бойня номер пять, или Крестовый поход детей | Автор: Курт Воннегут\n\nПовествование в романе Воннегута составлено из обрывков воспоминаний Билли Пилигрима. Это в книге главный герой. Он вызывает в \n\nпамяти события Второй мировой войны, участником которых он стал. Во время, которое для него является настоящим Билли находится в \n\nплену у укравших его инопланетян. «Бойня номер пять» написана фирменным стилем автора, который иногда называют «телеграфно-\n\nшизофреническим», кому-то язык и стиль может напомнить Паланика. А, может, правильнее сказать, что «Бойцовский клуб» напоминает \n\n«Бойню номер пять», потому что она написана раньше. Воннегут прекрасно знает, о чем пишет – он ветеран войны. В одном месте \n\nговорится, что «глаза русских заключенных в концлагере напоминали циферблаты часов». Прочитайте эту книгу – это одно из самых \n\nглубоких произведений о жизни и войне, отличающееся черным юмором и сатирой.\n\nСтоимость: 200 рублей.');
INSERT INTO `pl` (`img`, `id`, `discript`) VALUES
(, 2, 'Роботы утренней зари | Автор: Айзек Азимов\n\nДетективу Эллайджу Бэйли получают еще более сложное дело, чем те, с которыми он сталкивался в романах «Стальные пещеры» и «Обнаженное солнце». На этот раз кто-то убил робота на планете «Аврора» – это одна из планет, заселенная колонизаторами с Земли. Проблема заключается в том, что на подозрении оказался местный политик, который дружественно настроен к Земле. Если Бейли не сможет доказать его невиновность, то к власти могут прийти партия сторонников войны с Землей, что при ее слабости будет равносильно катастрофе.\n\nСтоимость: 330 рублей.');
INSERT INTO `pl` (`img`, `id`, `discript`) VALUES
(, 3, 'Конные Варвары | Автор: Гарри Гаррисон\n\nНасыщенный событиями и драматичный фантастический боевик от Гарри Гаррисона. Это писатель не одного удачного романа. Каждая его работа держит читателя в напряжении от начала и до конца. В книге главный герой, Язон дин Альт высаживается с людьми с его планеты на другой планете с целью определения ее пригодности для колонизации. Некоторое время назад на этой планете от рук местных аборигенов с луками и лошадьми погиб отряд добытчиков полезных ископаемых, несмотря на то, что бы вооружен всей мощью технологий. Язон дин Альт попадает в плен к варварам. И теперь его жизнь будет зависеть от общения с вождем варварских племен.\n\nСтоимость: 400 рублей.\n');
INSERT INTO `pl` (`img`, `id`, `discript`) VALUES
(, 4, 'Обнаженное солнце | Автор: Айзек Азимов\n\nПланета «Солярия» – сообщество колонистов с «Земли», где убийства абсолютно невозможны. Только двадцать тысяч человек живут здесь, каждый имеет собственное поместье, где вся хоть сколько-нибудь значительная работа исполняется роботами. Планета напоминает пуддинг, где люди, как изюминки попадаются иногда в толще роботизированной экономики. Каждый робот связан протоколами, которые воспрещают бездействие, если существует риск убийства одного человека другим. Но убийство все-таки случается. У «Солярии» нет полиции, поэтому она попросила Землю, чтобы та прислала своего детектива Эллайджа Бейли, который блестяще расследовал убийство колониста на Земле в романе «Стальные пещеры».\n\nСтоимость: 350 рублей.\n');
INSERT INTO `pl` (`img`, `id`, `discript`) VALUES
(, 5, 'Стальные пещеры | Автор: Айзек Азимов\n\nЧеловечество распространилось на сотни планет. Общества, которые там родились – избрали другой путь развития, чем земля. Старая Земля страдала от перенаселения, люди ненавидели роботов, потому что они лишали их рабочих мест. Они стали жить под землей, так как из-за скученности городов, к которой они привыкли, стали бояться открытых пространств, путешествий и природы. Другие планеты не были столь консервативны и скоро стали сильнее Земли, угрожая ей уничтожением. В этот момент на Земле происходит убийство колониста, которое должен расследовать детектив Эллайдж Бейли. От успеха зависят отношения с другими планетами.\n\nСтоимость: 500 рублей.\n');

